import React from 'react';
import { Outlet, Link } from "react-router-dom";
import "./Navbar.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell, faChevronRight, faUser } from '@fortawesome/free-solid-svg-icons';
import LogoIcon from '../images/Cavero_Icon.png';

function Navbar() {
  return (
    <div className='navbar-container'>
        <div className='side-navbar-container'>
            <div className='brand-container'>
                <img src={LogoIcon} className='brand-img' alt='Cavero'/>
                <div className='brand-name'>
                    Cavero<br/>IT Consultancy
                </div>
                <a href='#'>
                    <div className='brand-minimize-navbar'>
                        <FontAwesomeIcon icon={faChevronRight} color='white' size='s'/>
                    </div>
                </a>
            </div>
        </div>
        <div className='top-navbar-container'>
            <nav>
                <ul>
                    <li>
                        <FontAwesomeIcon icon={faBell}/>
                    </li>
                    <li>
                        <a>Hallo, Karsten <FontAwesomeIcon icon={faUser}/></a>
                    </li>
                </ul>
            </nav>
        </div>
        <Outlet />
    </div>
    
  );
}

export default Navbar;
